import React from "react";
import { Card, Input } from "antd";

//ACTIONS DE REDUX
import { crearNuevoProductoAction } from "../actions/documentosActions";
import { FullscreenExitOutlined, AudioOutlined } from "@ant-design/icons";

const Documentos = () => {
  const { Search } = Input;
  const onSearch = value => console.log(value);

  //DATOS PRUEBAS
  const dataSource = [
    {
      key: '1',
      name: 'Mike',
      age: 32,
      address: '10 Downing Street',
    },
    {
      key: '2',
      name: 'John',
      age: 42,
      address: '10 Downing Street',
    },
  ];
  
  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Age',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
  ];
  return (
    <div className="site-card-border-less-wrapper">
      <Card
        title="Documentos"
        bordered={false}
        style={{ width: FullscreenExitOutlined }}
      >
        <form action="">
       
        <Search placeholder="Ingresar texto a buscar" onSearch={onSearch} style={{ width: 200 }} />
        </form>
     
      </Card>

      <Table dataSource={dataSource} columns={columns} />;
    </div>
  );
};

export default Documentos;
